def parse_chapter(book_id, chapter_no, notes):
  usfm = "\\c {}\n".format(int(chapter_no))
  sep = "."
  for note in notes:
    verse_no = int(note["name"].split(sep)[0] if sep in note["name"] else note["name"])
    
    # print(chapter_no, "=>", verse_no)
    usfm += "\\p\n\\v {}\n".format(verse_no)

    note_url = raw_url.format(book_id, chapter_no, note["name"]).lower()
    
    import urllib.request
    notes = urllib.request.urlopen(note_url)

    for line in notes:
      next_line = line.decode('utf-8').strip()
      if next_line != "":
        if "#" in next_line:
          usfm += "\\b\n"
        usfm += "\\tr \\tc1 {}\n".format(line.decode('utf-8').strip()
                                         .replace("#", "").replace("<<", '\u201c').replace(">>", '\u201d'))
  return usfm

def traverse_dir_tree(dir_name, project_id, repo_dir_tree, write_usfm_file):
  books = []
  for dir in repo_dir_tree:
    usfm = ""
    if len(dir["subdirs"]) > 0 and "." not in dir: # and dir["name"] == 'phm/01':
      book_id = dir["name"].upper()

      sep = "/"
      if sep in book_id:
        book_id, chapter_no = book_id.split(sep)
        usfm += "\\id {}\n".format(book_id)
        
        usfm += parse_chapter(book_id, chapter_no, dir["subdirs"])
      else:
        usfm += "\\id {}\n".format(book_id)
        
        for sdir in dir['subdirs']:
          chapter_no = sdir["name"]
          if chapter_no.isnumeric():
            usfm += parse_chapter(book_id, chapter_no, sdir["subdirs"])
    
    if usfm != '':
      books.append((book_id, usfm))
      print("Directory {} traversed successfully!".format(book_id))
      # Writing the data to usfm file if the function is given
      if write_usfm_file is not None:
        write_usfm_file(dir_name, project_id, book_id, usfm)

  print("Traversed Repo successfully!")
  return books

def construct_filename(dir_name, book_seq, book_id, project_id):
    return "{}/{}{}{}.SFM".format(dir_name, book_seq, book_id.upper(), project_id)

def write_usfm_file(dir_name, project_id, book_id, data, encoding="utf-8"):
    from scripture import scripture
    
    filename = construct_filename(dir_name, scripture.get_book_seq(bk=book_id, paratext=True),
                                  book_id, project_id)
    
    with open(filename, encoding=encoding, mode="w") as f:
        f.write(data)
        print("{} written successfully for Book Id {}!".format(filename, book_id))


